function getPlayerGameLogAJAX(n,t,i){return this.PlayerID=n,this.Season=t,this.SeasonType=i,this.queryString="?PlayerID="+n+"&Season="+t+"&SeasonType="+i,this.apiURL="http://stats.nba.com/stats/playergamelog/"+this.queryString,$.ajax({url:this.apiURL,success:function(n){return console.log("Player Game log AJAX Request successfully transmitted."),n},error:function(n,t,i){return console.log("Status: "+t),alert("Error: "+i),null}})}function PlayerLog(n){this.playerLogObject=n.responseJSON;this.PlayerID=this.playerLogObject.parameters.PlayerID;this.Season=this.playerLogObject.parameters.Season;this.SeasonType=this.playerLogObject.parameters.SeasonType;this.Resource=this.playerLogObject.resource;this.Headers=this.playerLogObject.resultSets[0].headers;this.RowSet=this.playerLogObject.resultSets[0].rowSet}function postJSONStringToServerAJAX(n,t){$.ajax({url:n,type:"POST",contentType:"application/json; charset=utf-8",data:JSON.stringify({PlayerID:t.PlayerID,Season:t.Season,SeasonType:t.SeasonType,Resource:t.Resource,Headers:t.Headers,RowSet:t.RowSet}),error:function(n){alert(n.responseText)},success:function(n){alert(n)}})}$("#updateStats").click(function(){var n=getPlayerGameLogAJAX($("#playerID").val(),"2016-17","Regular Season").done(function(t){var i=new PlayerLog(n);return postJSONStringToServerAJAX("/PlayerProfiles/UpdateAverages",new PlayerLog(n)),console.log(i),t})});